<template>
  <ion-card
      class="ion-margin"
      style="background-image: url(data:image/png;base64,);
height: 300px;
background-position: left;
background-size: cover;
"
      @click="gotoDownload"
  >

  </ion-card>

</template>

<script>
import {IonCard} from "@ionic/vue";

export default {
  name: "AdSlider",
  components: {IonCard},
  computed: {
    OS() {
      const win = window;
      const mode = win && win.Ionic && win.Ionic.mode;
      return mode;

    },
    URL() {

      if (this.OS == 'ios') {

        return "https://apps.apple.com/gh/app/built-accounting/id1547855525";
      } else {
        return "https://play.google.com/store/search?q=built+accounting&c=apps";
      }
    }

  },
  methods: {
    gotoDownload() {

      window.location = this.URL;

    }
  }
}
</script>

